Let me think through this step by step...

The key psychological mechanisms involved in responder behavior in this ultimatum game are fairness considerations and self-interest.  Responders don't simply maximize their monetary gain; they also consider whether the proposed split is fair relative to the contributions of each player.  A highly unequal split, even if beneficial to the responder, might be rejected due to perceived unfairness.

These mechanisms interact in a way that a responder's utility is a function of both the monetary gain and the perceived fairness of the offer.  A fair offer with a smaller monetary gain might be more appealing than an unfair offer with a larger gain.

A simple mathematical form that captures this interaction could be a weighted linear combination of the monetary gain and a fairness metric.  The weights represent the relative importance of these factors for the individual responder.  The fairness metric could be calculated as the difference between the percentage of the total earnings each player receives relative to their respective token contributions.  A perfectly fair split would have this difference equal to zero.

To calibrate the model, we'll need two learnable parameters: one to weight the monetary gain (self-interest) and another to weight the fairness consideration.  These parameters allow us to capture individual differences in the relative importance of these two factors.


The model variables map to observable behavior as follows:  A higher combined weight of self-interest and fairness for a given offer will result in a higher predicted utility for accepting the offer, making acceptance more likely.  Conversely, a lower combined weight, indicating a greater emphasis on fairness or a lower monetary gain, will lead to a lower utility, making rejection more likely.  The model only predicts the utility of accepting; rejection is handled separately.

